import React from 'react'
import './ResourceView.css'
import { Link } from 'react-router-dom';

export default class resourcePreview extends React.Component {


    render(props) {
        // id= {this.props.resource.id};
            return(
            <section id="resource">
                <div id="resourceImage">{this.props.resource.image}</div>
                <div id="resourceText">
                    <h3 id="resourceText">{this.props.resource.headline}</h3>
                    <p id="resourceText">{this.props.resource.summary}</p>
                    <Link to={"/dashboard/resource/"+this.props.resource.id}><button>View Full resource</button></Link>
                </div>
            </section>
                );
}
}
